import React from "react";

const MonthlyAmount = (): JSX.Element => {
  return (
    <div>
      <div>Monthly amount</div>
      <div>$520.83</div>
      <p>
        You’re planning 48 monthly deposits to reach your $25,000 goal by
        October 2020.
      </p>
    </div>
  );
};

export default MonthlyAmount;
